package maximum_score_from_removing_substrings

import "testing"

func TestMaxGainForTestCase1(t *testing.T) {
	input := "cdbcbbaaabab"
	x := 4
	y := 5
	output := maximumGain(input, x, y)
	expect := 19
	if output != expect {
		t.Fatalf("TestMaxGainForTestCase1 failed with output as %d however expected is %d", output, expect)
	}
}

